import "./App.css";
import "./java.js";
import axios from 'axios'


function App() {
  return (
    <div className="App">

    </div>
  );
}

function login(e){
    e.preventDefault();
    let request ={
        email:document.getElementById('username').value, 
        password:document.getElementById('password').value
    }
    axios.post('http://localhost:8080/login',request)
    .then(resp=>{
        alert(resp.data.message);
    })
    .catch(err=>{
        console.log(err);
    })
}

export default App;
